import { colors } from "@material-ui/core";
import { Button } from "bootstrap";
import React from "react";
import "../../.././assets/index.css";
import Buttons from "../Buttons/Buttons";

const SearchBar = ({name, onSubmitHandler,onChangeHandler}) => {
  return (
    <form action="/" method="get">
      <div style={{ height: "40px", display: "flex", flexDirection: "row" }}>
        <label htmlFor="header-search">
          <span className="visually-hidden">Search for People</span>
        </label>
        <input
          type="text"
          id="header-search"
          placeholder="Search for People..."
          name="searchBar"
          style={{ width: "400px", height: "40px", padding: "5px" }}
        />
        <Buttons
            value="Search"
            style={{
              height:"40px",
              fontSize:"20px",
              background: "black",
              borderColor: "crimson",
              color: "crimson",
              borderRadius:"0px",
              marginLeft:"10px"
            }}
            onClick = {onSubmitHandler}
        />
      </div>
    </form>
  );
};
export default SearchBar;
